class Solution(object):
	def longestOnes(self, nums, k):
		"""
		:type nums: List[int]
		:type k: int
		:rtype: int
		"""
		left = 0
		longest = 0
		swapTry = 0
		for i in range(len(nums)):
			if nums[i] == 0:
				swapTry +=1
			if swapTry > k:
				if nums[left] == 0:
					swapTry -= 1
				left += 1
			else:
				longest = max(longest, i - left + 1)
			
		return longest
		
			
